import React from "react";
import Meena from "./img/meena.jpg";

const Profile = () => {
  return (
    <div className="grid grid-cols-3">
      <div className="bg-purple-200 h-screen p-2">
        <div>
          <img src={Meena} alt="" />
        </div>
      </div>
      <div className="col-span-2 bg-red-200 h-screen p-2">Info</div>
    </div>
  );
};

export default Profile;
